import React from 'react'


const SearchListItem = ({course, cart, updateCart}) => {

    let getId = () => {
        return course.id
    }

    let getTitle = () => {
        return course.title
    }

    // let addCourse = () => {
    //     console.log('Button! Course :' + course.id)
    //     cart.push(course)
    //     setCart(cart)
    // }
    return (
        <div className = "search-list-item">
            <button onClick = {() => updateCart(course)}> + </button>
            <h3>{getId()}</h3>
            <p>{getTitle()}</p>
        </div>
    )
}

export default SearchListItem
